import React from 'react'
import styled from 'styled-components'

 export const Sidebar = styled.div`
    background-color: #3256D4;
    height: 100%;
    width: 30%;

`

function AdminPanel() {
    return (
        <Sidebar>
            <div>
                <h1>Admin Panel</h1>
            </div>
        </Sidebar>
    )
}

export default AdminPanel
